import React,{useEffect,useState} from "react";
import axios from "axios"
function Home()
{
    const [loginstate,setLoginState]= useState({name:'',email:''})
    useEffect(()=>{axios.get('http://localhost:8089/api/auth/user',{
    withCredentials: true,
    headers: {
      "Access-Control-Allow-Origin": "http://localhost:8089",
      "Access-Control-Allow-Credentials": true
    }})
  .catch(e=>console.log("no worky"))
  .then((res)=>{setLoginState({...res.data});
    console.log(loginstate.name+" nin")})

})
    return(<>Welcome Back {loginstate} </>);
}
export default Home;
